import './App.css';
import mainContainer from './containers/mainContainer'

function App() {

  fetch('http://localhost:3000/todos')
  .then(res => res.json())
  .then(todos => console.log(todos))

  return (
    <div className="App">
      <mainContainer />
    </div>
  );
}

export default App;
